import { StyleSheet } from 'react-native';

import { white } from '../../utils/colors';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: white,
    justifyContent: 'center',
    position: 'absolute',
    height: '100%',
    width: '100%'
  }
});

export default styles;
